import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import styles from './RaiseRequest.module.css';

const RaiseRequest = () => {
  const [serviceId, setServiceId] = useState('');
  const [description, setDescription] = useState('');
  const [message, setMessage] = useState('');
  const [isError, setIsError] = useState(false);
  const [isSubmitting, setIsSubmitting] = useState(false);
  const navigate = useNavigate();
  const userId = localStorage.getItem('userId');

  // Helper: Format JS Date to "YYYY-MM-DD HH:mm:ss"
  const formatDateForMySQL = (date) => {
    const pad = (n) => (n < 10 ? '0' + n : n);
    return (
      date.getFullYear() + '-' +
      pad(date.getMonth() + 1) + '-' +
      pad(date.getDate()) + ' ' +
      pad(date.getHours()) + ':' +
      pad(date.getMinutes()) + ':' +
      pad(date.getSeconds())
    );
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    if (!serviceId || !description.trim()) {
      setMessage('Please fill all fields');
      setIsError(true);
      setTimeout(() => setMessage(''), 3000);
      return;
    }

    setIsSubmitting(true);

    const now = new Date();
    const tomorrow = new Date(Date.now() + 86400000);

    const createDate = formatDateForMySQL(now);
    const exceptCompletionDate = formatDateForMySQL(tomorrow);

    const newRequest = {
      serviceId: parseInt(serviceId),
      userId: parseInt(userId),
      description: description.trim(),
      status: "Pending",
      createDate,
      exceptCompletionDate
    };

    axios.post('http://localhost:8080/requests/save', newRequest)
      .then(() => {
        setServiceId('');
        setDescription('');
        setIsError(false);
        setMessage('Request submitted successfully!');
        setTimeout(() => navigate('/userdashboard'), 2000);
      })
      .catch((error) => {
        console.error("Error submitting request:", error);
        setMessage(error.response?.data?.message || 'Something went wrong. Try again.');
        setIsError(true);
      })
      .finally(() => {
        setIsSubmitting(false);
        setTimeout(() => setMessage(''), 5000);
      });
  };

  return (
    <div className={styles.container}>
      <h2>Raise New Request</h2>

      {message && (
        <div className={isError ? styles.error : styles.success}>
          {message}
        </div>
      )}

      <form onSubmit={handleSubmit} className={styles.form}>
        <div className={styles.formGroup}>
          <label htmlFor="service">Select Service:</label>
          <select
            id="service"
            value={serviceId}
            onChange={(e) => setServiceId(e.target.value)}
            className={styles.select}
            required
            disabled={isSubmitting}
          >
            <option value="">-- Select a service --</option>
            <option value="1">Plumbing</option>
            <option value="2">Electricity</option>
            <option value="3">Garbage Collection</option>
            <option value="4">Maintenance</option>
            <option value="5">Cleaning</option>
            <option value="6">Security</option>
          </select>
        </div>

        <div className={styles.formGroup}>
          <label htmlFor="description">Description:</label>
          <textarea
            id="description"
            placeholder="Describe your request in detail..."
            value={description}
            onChange={(e) => setDescription(e.target.value)}
            className={styles.textarea}
            required
            disabled={isSubmitting}
          />
        </div>

        <div className={styles.buttonGroup}>
          <button
            type="submit"
            className={styles.submitButton}
            disabled={isSubmitting}
          >
            {isSubmitting ? 'Submitting...' : 'Submit Request'}
          </button>
          <button
            type="button"
            onClick={() => navigate('/userdashboard')}
            className={styles.cancelButton}
            disabled={isSubmitting}
          >
            Cancel
          </button>
        </div>
      </form>
    </div>
  );
};

export default RaiseRequest;
